                    ben_a_r <=  (((BYTE_ENABLE_S0 == 1'b1) || (UNALIGNED_ACCESS_EN_S0 == 1'b1)) ? ibus_cmd_payload_mask : {(DATA_WIDTH_A / 8){1'b1}}) ;
