    assign dbus_cmd_ready = dbus_bus_rdy ; 
    assign dbus_rsp_payload_data = (rd_ready_b[(RD_STAGE_B - 1)] ? rd_data_b_o : {ADDR_WIDTH_B{1'b0}}) ; 
    assign dbus_rsp_payload_error = ((|mem_error_b_o) | Port_B_out_of_bound_error) ; 
    assign dbus_rsp_valid = rd_ready_b[(RD_STAGE_B - 1)] ; 
    assign dbus_rd_hsked = dbus_rsp_valid ; 
    assign dbus_burst_wr_done = (size_b ? 1'b1 : (dbus_bst_wr_cnt == 3'b111)) ; // for simple, only support ibus_cmd_payload_size == 5, 2
    assign dbus_burst_done = (size_b ? 1'b1 : (dbus_bst_cnt == 3'b111)) ; // for simple, only support dbus_cmd_payload_size == 5, 2
    assign dbus_rsp_payload_last = dbus_burst_done ; 
    assign Port_B_out_of_bound_error = ((addr_b_i >= S1_END_ADDR) ? 1'b1 : 1'b0) ; 
    //  dbus address increment logic
    always
        @(posedge sys_clk or 
            negedge sys_rst_n)
        begin
            if ((~sys_rst_n)) 
                begin
                    dbus_incr_addr <=  {ADDR_WIDTH_B{1'b0}} ;
                end
            else
                begin
                    if (((dbus_cmd_valid == 1'b1) && (dbus_bus_rdy == 1'b0))) 
                        begin
                            dbus_incr_addr <=  (dbus_cmd_payload_address[((ADDR_WIDTH_B + OFFSET_B) - 1):OFFSET_B] + S1_START_ADDR) ;
                        end
                    else
                        if ((rd_en_b_r == 1'b1)) 
                            begin
                                dbus_incr_addr <=  (dbus_incr_addr + 1'b1) ;
                            end
                        else
                            if ((wr_en_b_r == 1'b1)) 
                                begin
                                    dbus_incr_addr <=  (dbus_incr_addr + 1'b1) ;
                                end
                end
        end
    // dbus payload size logic
    always
        @(posedge sys_clk or 
            negedge sys_rst_n)
        begin
            if ((~sys_rst_n)) 
