                end
            else
                begin
                    if (((dbus_cmd_valid == 1'b1) && (dbus_bus_rdy == 1'b0))) 
                        begin
                            size_b <=  ((dbus_cmd_payload_size == 3'b101) ? 1'b0 : 1'b1) ;
                        end
                end
        end
    // Port B byte enable logic
    always
        @(posedge sys_clk or 
            negedge sys_rst_n)
        begin
            if ((~sys_rst_n)) 
                begin
                    wr_data_b_r <=  {DATA_WIDTH_B{1'b0}} ;
                    ben_b_r <=  {(DATA_WIDTH_B / 8){1'b0}} ;
                end
            else
                begin
                    wr_data_b_r <=  dbus_cmd_payload_data ;
                    ben_b_r <=  (((BYTE_ENABLE_S1 == 1'b1) || (UNALIGNED_ACCESS_EN_S1 == 1'b1)) ? dbus_cmd_payload_mask : {(DATA_WIDTH_B / 8){1'b1}}) ;
                end
        end
    always
        @(posedge sys_clk or 
            negedge sys_rst_n)
        begin
            if ((~sys_rst_n)) 
                begin
                    wr_en_b_r <=  1'b0 ;
                end
            else
                begin
                    if ((((dbus_cmd_valid == 1'b1) && (dbus_cmd_payload_wr == 1'b1)) && (dbus_bus_rdy == 1'b0))) 
