                            wr_en_b_r <=  1'b1 ;
                        end
                    else
                        if ((((dbus_cmd_valid == 1'b1) && (dbus_cmd_payload_wr == 1'b1)) && (dbus_bus_rdy == 1'b1))) 
                            begin
                                wr_en_b_r <=  1'b0 ;
                            end
                        else
                            if ((size_b == 1'b1)) 
                                begin
                                    wr_en_b_r <=  1'b0 ;
                                end
                            else
                                if (((size_b == 1'b0) && (dbus_bst_wr_cnt == 3'b001))) 
                                    begin
                                        wr_en_b_r <=  1'b1 ;
                                    end
