                    assign mem1_wdata_w = mem_fifo_wdata_w ; 
                    assign mem1_byte_en_w = mem_fifo_byte_en_w ; 
                end
            else
                begin : genblk2
                    assign mem1_request_w = (fifo_interface_en_i | (wr_en_b_i | rd_en_b_r)) ; 
                    assign mem1_wr_rdn_w = (fifo_interface_en_i ? mem_fifo_clk_en_w : wr_en_b_i) ; 
                    assign mem1_addr_w = (fifo_interface_en_i ? mem_fifo_addr_w : addr_b_i) ; 
                    assign mem1_wdata_w = (fifo_interface_en_i ? mem_fifo_wdata_w : wr_data_b_i) ; 
                    assign mem1_byte_en_w = (fifo_interface_en_i ? mem_fifo_byte_en_w : ben_b_i) ; 
                end
        end
    else
