    function [31:0] procData ; 
        input [31:0] max_data ; 
        input [31:0] family_code ; 
        input [31:0] factor ; 
        begin
            case (family_code)
            _FCODE_LIFCL_ : 
                begin
                    procData = 8 ;
                    if ((max_data <= 8)) 
                        begin
                            procData = (8 * factor) ;
                        end
                    else
                        if ((max_data <= 16)) 
                            begin
                                if ((factor > 2)) 
                                    begin
                                        procData = 32 ;
                                    end
                                else
                                    begin
                                        procData = 16 ;
                                    end
                            end
                        else
                            begin
                                while ((procData < max_data))
                                    begin
                                        procData = (procData * 2) ;
                                    end
                            end
                end
            endcase 
        end
    endfunction
    function [31:0] getDatabase ; 
        input [31:0] base_count ; 
        input [31:0] idx ; 
        input [31:0] family_code ; 
        begin
            case (family_code)
            _FCODE_LIFCL_ : 
                begin
                    case (idx)
                    0 : 
                        getDatabase = 32 ;
                    1 : 
                        getDatabase = 16 ;
                    2 : 
                        getDatabase = 8 ;
                    endcase 
                end
            default : 
                getDatabase = 32 ;
            endcase 
        end
    endfunction
    function [31:0] getMixDataImpl ; 
        input [31:0] addr_a_depth ; 
        input [31:0] data_a_width ; 
        input [31:0] addr_b_depth ; 
        input [31:0] data_b_width ; 
        input isRetForPortA ; 
        input isGettingTotalSize ; 
        input family_code ; 
        reg [5:0] n0, 
            n1 ; 
        reg [31:0] divisor, 
            addr_div_portA, 
            data_div_portA, 
            addr_div_portB, 
            data_div_portB ; 
        reg [31:0] portA_addr_chk, 
            portA_data_chk, 
            portB_addr_chk, 
            portB_data_chk ; 
        reg [31:0] EBR_usage, 
            PROD, 
            porta_factor, 
            portb_factor ; 
        begin
            divisor = ((addr_a_depth > addr_b_depth) ? (addr_a_depth / addr_b_depth) : (addr_b_depth / addr_a_depth)) ;
            porta_factor = ((data_a_width > data_b_width) ? 1 : divisor) ;
            portb_factor = ((data_a_width > data_b_width) ? divisor : 1) ;
            EBR_usage = {32{1'b1}} ;
            getMixDataImpl = 0 ;
            case (family_code)
            _FCODE_LIFCL_ : 
                begin
                    for (n0 = 0 ; (n0 < 3) ; n0 = (n0 + 1))
                        begin
                            data_div_portA = getDatabase(32,
                                    n0,
                                    family_code) ;
                            addr_div_portA = data_to_addr(data_div_portA,
                                    family_code) ;
                            portA_addr_chk = roundUP(addr_a_depth,
                                    addr_div_portA) ;
                            portA_data_chk = roundUP(data_a_width,
                                    data_div_portA) ;
                            for (n1 = 0 ; (n1 < 3) ; n1 = (n1 + 1))
                                begin
                                    data_div_portB = getDatabase(32,
                                            n1,
                                            family_code) ;
                                    addr_div_portB = data_to_addr(data_div_portB,
                                            family_code) ;
                                    portB_addr_chk = roundUP(addr_b_depth,
                                            addr_div_portB) ;
                                    portB_data_chk = roundUP(data_b_width,
                                            data_div_portB) ;
                                    if (((portA_addr_chk == portB_addr_chk) && (portA_data_chk == portB_data_chk))) 
                                        begin
                                            if (((porta_factor * data_div_portA) == (portb_factor * data_div_portB))) 
                                                begin
                                                    PROD = (portA_addr_chk * portA_data_chk) ;
                                                    if ((PROD < EBR_usage)) 
                                                        begin
                                                            EBR_usage = PROD ;
                                                            if (isGettingTotalSize) 
                                                                begin
                                                                    getMixDataImpl = EBR_usage ;
                                                                end
                                                            else
                                                                begin
                                                                    getMixDataImpl = (isRetForPortA ? data_div_portA : data_div_portB) ;
                                                                end
                                                        end
                                                end
                                        end
                                end
                        end
                end
            endcase 
        end
    endfunction
    function [31:0] data_to_addr ; 
        input [31:0] data_size ; 
        input [31:0] family_code ; 
        begin
            case (family_code)
            _FCODE_LIFCL_ : 
                begin
                    case (data_size)
                    32 : 
                        data_to_addr = 16384 ;
                    16 : 
                        data_to_addr = 32768 ;
                    8 : 
                        data_to_addr = 65536 ;
                    default : 
                        data_to_addr = 16384 ;
                    endcase 
                end
            default : 
                data_to_addr = 16384 ;
            endcase 
        end
    endfunction
    function [31:0] roundUP ; 
        input [31:0] dividend ; 
        input [31:0] divisor ; 
        begin
            if ((divisor == 1)) 
                begin
                    roundUP = dividend ;
                end
            else
                if ((divisor == dividend)) 
                    begin
                        roundUP = 1 ;
                    end
                else
                    begin
                        roundUP = ((dividend / divisor) + (((dividend % divisor) == 0) ? 0 : 1)) ;
                    end
        end
    endfunction
    function [31:0] LRAM_impl ; 
        input [31:0] DEPTH_IMPL ; 
        input [31:0] WIDTH_IMPL ; 
        input [31:0] ADDR_DEPTH_X ; 
        input [31:0] DATA_WIDTH_X ; 
        begin
            LRAM_impl = (roundUP(DEPTH_IMPL,
                    ADDR_DEPTH_X) * roundUP(WIDTH_IMPL,
                    DATA_WIDTH_X)) ;
        end
    endfunction
    function [31:0] getMinimaData ; 
        input [31:0] depth_impl ; 
        input [31:0] width_impl ; 
        input isForce32 ; 
        input [31:0] family_code ; 
        reg [31:0] temp_00, 
            temp_01, 
            temp_02 ; 
        begin
            case (family_code)
            _FCODE_LIFCL_ : 
                begin
                    if (isForce32) 
                        begin
                            getMinimaData = 32 ;
                        end
                    else
                        begin
                            temp_00 = LRAM_impl(depth_impl,
                                    width_impl,
                                    16384,
                                    32) ;
                            temp_01 = LRAM_impl(depth_impl,
                                    width_impl,
                                    32768,
                                    16) ;
                            temp_02 = LRAM_impl(depth_impl,
                                    width_impl,
                                    65536,
                                    8) ;
                            if ((temp_00 <= temp_01)) 
                                begin
                                    if ((temp_00 <= temp_02)) 
                                        begin
                                            getMinimaData = 32 ;
                                        end
                                    else
                                        begin
                                            getMinimaData = 8 ;
                                        end
                                end
                            else
                                begin
                                    if ((temp_01 <= temp_02)) 
                                        begin
                                            getMinimaData = 16 ;
                                        end
                                    else
                                        begin
                                            getMinimaData = 8 ;
                                        end
                                end
                        end
                end
            default : 
                getMinimaData = 32 ;
            endcase 
        end
    endfunction
    function [31:0] clog2 ; 
        input [31:0] value ; 
        reg [31:0] num ; 
        begin
            num = (value - 1) ;
            for (clog2 = 0 ; (num > 0) ; clog2 = (clog2 + 1))
                num = (num >> 1) ;
        end
    endfunction
